import React from "react";
import { Route, BrowserRouter as Router, Switch } from 'react-router-dom';
import { CartProvider } from "./component/CartContext";
import HomePage from "./user/homepage/HomePage";
// import Main from "./user/homepage/main_products";
import Main from "../src/user/products/Main";
import HomeLanding from "./user/landingpage/HomeLanding";
import NavBar from "./user/landingpage/navbar";
import Dresses from "./user/products/Dresses";
import Shoes from "./user/products/Shoes";
import BuyingPage from "./vendor/BuyingPage";
import CartPage from "./vendor/CartPage";
impo
function App() {
  return(
    <CartProvider>
    <Router>
    
    <NavBar />
    <Switch>
      <Route exact path = "/productShoes"><Main/></Route>
      <Route path = "/Home"><HomeLanding /></Route>
    </Switch>
      <NavBar/>
      <Switch>

        <Route exact path="/home" >
          <HomePage/>
        </Route>

        <Route exact path="/Shoes" >
          <Shoes/>
        </Route>
        
        <Route exact path="/Dresses" >
          <Dresses/>
        </Route>
        <Route path="/buy" component={BuyingPage} />
          <Route path="/cart" component={CartPage} />
        
      </Switch>


    </Router>
    </CartProvider>
   
